// src/RepositoriesList.js
import React, { useState, useEffect } from 'react';
import { getRepositories } from './api'; // Import your API functions
import { Link } from 'react-router-dom';

function RepositoriesList() {
    const [repositories, setRepositories] = useState([]);

    useEffect(() => {
        // Fetch repositories from API and update state
        getRepositories()
            .then(response => setRepositories(response.data))
            .catch(error => console.error('Error fetching repositories:', error));
    }, []);

    return (
        <div>
            <h2>Repositories List</h2>
            <ul>
                {repositories.map(repo => (
                    <li key={repo.id}>
                        {/* Use the Link component to create a link */}
                        <Link to={`/repository/${repo.id}`}>{repo.name}</Link>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default RepositoriesList;
